- input: "TEXT\x1CC00167320\x1CX0\x1C\x1CF3XA\x1C1.\tThe original memo text from the
    amendment explains that two contributions were inadvertently left off of the original
    report and were reported when the error was discovered.    2.\tAs stated in the
    memo text of the previous amended report filed on 12/15/08,  ?Due to human error,
    the original Post General report was missing its Schedule F; this amended report
    includes its Schedule F and all of the correct itemized coordinated expenditures.?
    \ This accounts for $28,144.21.  ?The original Post General report inadvertently
    was missing contributions and disbursements associated with our ASDC Joint Victory
    account, this has been corrected and all contributions and disbursements are disclosed
    in this amended report.? This accounts for disbursements totaling $17,974.14 and
    the Line 28 Contribution Refund of $111.11.  (While working on this report, it
    was discovered there was another refund in the amount of $108.70 that had been
    dated incorrectly and should appear in this report- that has been corrected.)
    Due to a technical software issue, the remaining $25,496.13, although entered
    in the database were not disclosing, this issue was inadvertently resolved prior
    to the 1/29/08 amendment and the Party was not aware of it until the receipt of
    this letter.    3. \tWith recent corrections made in previous reports, Line 11(a)(iii),
    Column B  equals $241,564.11 in this amended report.     4.  The memo entries
    for ?ASDC Joint Victory Account? have been clarified.    5.  The receipts disclosed
    on Line(s) 12 from ?Courtney for Congress?, ?Friends of Chris Dodd?, ?Jim Himes
    for Congress? and ?Larson for Congress? are all individual transfers of funds
    from Affiliated/Other Party Committees.    6. The memo entries in questions are
    as follows:  an 11/3/08 disbursement for $114.45 to David Joseph for office supplies
    purchased at Staples.  The second entry is the $163.22 paid to Rachel Koteen on
    11/3/08 for copies made at Kinko?s.  Each of these entries is correctly entered
    into our compliance software but due to the fact that each reimbursement to the
    individuals was under the $200 threshold, they weren?t disclosing on the report.
    \ The actual businesses do appear though because the disbursement aggregate amounts
    for both vendors are over $200.     7. The payments made for ?Postage and Ship
    (Gen. Exp.)? are ordinary operating expenses, as was the Kinko?s disbursement
    for ?Printing (Gen. Exp.)? on 11/03/08 for $507.   The disbursement made for ?Production
    Expenses ? AV, lights.? was for an Election Night Reception.    The remaining
    printing disbursements made to:360 JMG, LLC, Christian Murray Design,  Mission
    Control, Barker Specialty and Washington Promos were for exempt activities that
    were incorrectly on Line 21 (b), these disbursements have been moved to Line 30
    (b).  The Committee met the ?Exempt Activity? rules with distribution of the lawns
    signs, literature and mail, through volunteers, no paid advertising was used,
    nor direct mail by a commercial vendor using a commercial list.    8. \tThe expenditures
    made ?Room Rental? were for Party activities and were not made on behalf of or
    for any candidate.  The room rental for $2,959.70 to Hamden Public Schools was
    for a Party meeting and the room rental of $3,397.50 to Tech Theatrical Services
    was for an Election Night Celebration.    9./10.\tDue to an incorrect code entered
    in our software, payments made for ?Voter file software consulting?, ?Voter file
    updates? and ?Salary? were incorrectly disclosed on Line 21 (b), the codes have
    been corrected and these payments are now correctly disclosed as Federal Election
    Activity on Line 30 (b).        \n"
